import React from 'react';  
import { Link } from 'react-router-dom';  
  
const Navbar = () => {  
  return (  
    <nav className="bg-gray-800 p-4">  
      <div className="max-w-4xl mx-auto flex justify-between items-center"> {/* Use justify-between for better spacing */}  
        <h1 className="text-3xl font-bubblegum text-white font-bold">Polygon Panda Party</h1> {/* Improved styling */}  
        <div className="flex space-x-4"> {/* Added spacing between buttons */}  
          <Link to="/winners">  
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">  
              View Current Winners üèÜ  
            </button>  
          </Link>  
          <Link to="/past-winners">  
            <button className="bg-purple-500 hover:bg-purple-700 text-white font-bold py-2 px-4 rounded">  
              View Past Winners üìú  
            </button>  
          </Link>  
          <Link to="/about">  
            <button className="bg-green-500 hover:bg-green-700 text-white font-bold py-2 px-4 rounded">  
              About  
            </button>  
          </Link>  
        </div>  
      </div>  
    </nav>  
  );  
};  
  
export default Navbar;
